function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <div className="App__Aside"></div>
        <div className="App__Form">
          <div className="PageSwitcher">
            <a href="#" className="PageSwitcher__Item">
              Login
            </a>
            <a
              href="#"
              className="PageSwitcher__Item PageSwitcher__Item__Active"
            >
              Sign Up
            </a>
          </div>

          <div className="FormTitle">
            <NavLink to="/login" activeClassName="FormTitle__Link__Active" className="FormTitle__Link">
              Login
            </NavLink>{" "}
            or{" "}
            <NavLink exact to="/" activeClassName="FormTitle__Link__Active" className="FormTitle__Link FormTitle__Link__Active">
              Sign Up
            </NavLink>
          </div>

          <Route exact path="/" component={LoginForm} >

          </Route>

          <Route path="/login" component={SignInForm}>

          </Route>


        </div>


      </div>

    </BrowserRouter>
  );
}

export default App;
